  jQuery.ajax({
    url: wpcf7cf_global_settings.ajaxurl + '?action=wpcf7cf_get_summary',
    type: 'POST',
    data: fd,
    processData: false,
    contentType: false,
    dataType: 'json',
    success: function success(json) {
      $summary.html(json.summaryHtml);
    }
  });
